import { useGetProductsQuery } from "../../../store/servises";
import { ProductItem } from "./ProductItem";

export const Products = () => {
  const { data } = useGetProductsQuery("5");
  console.log(data);
  return (
    <div>
      {data.products.map((p) => (
        <ProductItem title={p.title} img={p.images[0]} price={p.p}/>
      ))}
    </div>
  );
};
